from gi.repository import Gtk, Gdk, GdkPixbuf, Pango, GObject
from gi.repository import Granite
from kanji_to_romaji import kanji_to_romaji
import xml.etree.ElementTree

class main_window(Gtk.Window):

  def __init__(self):
    Gtk.Window.__init__(self, title="")

    cssProvider = Gtk.CssProvider()
    cssProvider.load_from_path('style.css')
    screen = Gdk.Screen.get_default()
    styleContext = Gtk.StyleContext()
    styleContext.add_provider_for_screen(screen, cssProvider, Gtk.STYLE_PROVIDER_PRIORITY_USER)

    self.get_kanji()
    self.create_window()
    self.create_headerbar()

  def create_headerbar(self):
    headerbar = Gtk.HeaderBar()
    headerbar.set_name("headerbar")
    headerbar.set_show_close_button(True)
    headerbar.props.title = "Japanese input"
#    headerbar.get_style_context().add_class(Gtk.STYLE_CLASS_FLAT)
    self.set_titlebar(headerbar)

    copybt = Gtk.ToolButton()
    copybt.set_icon_name("edit-copy")
    copybt.connect("clicked", self.copy_text)
    headerbar.pack_start(copybt)

  def create_window(self):
    self.box = Gtk.HBox()
    self.add(self.box)
    self.create_textview()
    self.create_kanjiview()

  def create_textview(self):
    PageScroll = Gtk.ScrolledWindow()
    TextView = Gtk.TextView()
    TextView.set_name("TextView")
    TextView.set_wrap_mode(Gtk.WrapMode.WORD)
    PageScroll.add(TextView)
    PageScroll.set_margin_top(12)
    PageScroll.set_margin_bottom(12)
    PageScroll.set_margin_left(12)
    PageScroll.set_margin_right(12)
    self.box.pack_start(PageScroll, True, True, 0)

    self.TextBuffer = TextView.get_buffer()
    self.TextBuffer.connect("changed", self.switch_characters)
    self.size = self.TextBuffer.create_tag("size", size=51200)
    self.TextBuffer.apply_tag(self.size, self.TextBuffer.get_start_iter(), self.TextBuffer.get_end_iter())

  def create_kanjiview(self):
    kanjiview_box = Gtk.VBox()

    romajientry = Gtk.Entry()
    romajientry.set_margin_top(12)
    romajientry.set_margin_bottom(12)
    romajientry.set_margin_left(12)
    romajientry.set_margin_right(0)

    btn = Gtk.Button(label="Find Kanji")
    btn.connect("clicked", self.search_kanji, romajientry)
    btn.set_margin_top(12)
    btn.set_margin_bottom(12)
    btn.set_margin_left(0)
    btn.set_margin_right(12)

    KVBox = Gtk.HBox()
    KVBox.pack_start(romajientry, False, False, 0)
    KVBox.pack_start(btn, False, False, 0)
    KVBox.get_style_context().add_class("linked")

    KVBoxWrapper = Gtk.HBox()
    KVBoxWrapper.pack_start(KVBox, True, False, 0)

    separator = Gtk.Separator.new(Gtk.Orientation.VERTICAL)
    self.box.pack_start(separator, False, True, 0)

    kanjiview_box.pack_start(KVBoxWrapper, False, True, 0)

    self.kanji_liststore = Gtk.ListStore(str, str)
    for kanji_ref in self.hybridarray:
      self.kanji_liststore.append(list(kanji_ref))

    self.current_filter_kanji = None
    self.kanji_filter = self.kanji_liststore.filter_new()
    self.kanji_filter.set_visible_func(self.kanji_filter_func)

    self.treeview = Gtk.TreeView.new_with_model(self.kanji_filter)

    for i, column_title in enumerate(["kanji", "reading"]):
      renderer = Gtk.CellRendererText()
      column = Gtk.TreeViewColumn(column_title, renderer, text=i)
      self.treeview.append_column(column)

    self.treeview.connect("row-activated", self.insert_kanji, self.treeview.get_model())

    kanjiscroll = Gtk.ScrolledWindow()
    kanjiscroll.add(self.treeview)
    kanjiscroll.set_property("width-request", 100)
    kanjiview_box.pack_start(kanjiscroll, True, True, 0)
    self.box.pack_start(kanjiview_box, False, False, 0)

  def insert_kanji(self, sender, iter, path, model):
    print(model[iter][1])
    self.TextBuffer.set_text(self.TextBuffer.get_text(self.TextBuffer.get_start_iter(), self.TextBuffer.get_end_iter(), False) + model[iter][0])

  def search_kanji(self, sender, romajientry):
    kanjiquery = romajientry.get_text()
    self.current_filter_kanji = kanjiquery
    self.kanji_filter.refilter()

  def kanji_filter_func(self, model, iter, data):
    if self.current_filter_kanji is None or self.current_filter_kanji == "None":
      return True
    else:
      return model[iter][1].startswith(self.current_filter_kanji)

  def copy_text(self, sender):
    clipboard = Gtk.Clipboard.get(Gdk.SELECTION_CLIPBOARD)
    clipboard.set_text(self.TextBuffer.get_text(self.TextBuffer.get_start_iter(), self.TextBuffer.get_end_iter(), False), -1)

